import { createApp } from 'vue';
import App from './App.vue';
import router from './router';
import store from './store';
import 'vuetify/dist/vuetify.css'; // Import Vuetify CSS
import Vuetify from 'vuetify'; // Import Vuetify library
import '@mdi/font/css/materialdesignicons.css'; // Import the Material Design Icons CSS

const app = createApp(App);

app.use(router).use(store);

const vuetify = new Vuetify(); // Create a new instance of Vuetify

app.use(vuetify); // Use Vuetify instance

app.mount('#app');
